INSERT INTO `store` VALUES (7,1,'天猫超市','/profile/upload/2024/06/06/111_20240606192947A005.jpg','梅园特色餐厅一楼 作为淘天集团旗下优质平价的线上超市，天猫超市业务覆盖全国，并在多数城市实现了当日达和次日达。天猫超市通过甄选商品源，100%保证商品品质，提供更丰富和更本地化的商品供应；采用专业仓储物流，提供“半日达”、“次日达”等灵活配送服务；致力于满足广大消费者全场景生活需求。采用商品统一入仓、统一专业打包，追求一站购齐的便捷体验。天猫超市1次买齐送上门。'),(8,1,'711便利店','/profile/upload/2024/06/06/2024-06-06_193300_20240606193302A008.jpg','梅园食堂一楼 7-11（日语：セブン－イレブン）便利店（商标中的表记方式为：7-ELEVEn）7-Eleven品牌原属美国南方公司，2005年成为日本公司。 Seven&I Holdings公司是Seven-Eleven Japan公司、Ito－Yokado公司、Denny’s Japan公司在2005年9月合并成立的新公司。1927年在美国德克萨斯州创立，7-Eleven的名称则源于1946年，藉以标榜营业时间由上午7时至晚上11时，后由日本零售业经营者伊藤洋华堂于1974年引入日本，从1975年开始变更为24小时全天候营业。'),(9,1,'茶百道','/profile/upload/2024/06/06/2024-06-06_194114_20240606194132A014.jpg','梅园食堂一楼 茶百道，是中国茶饮连锁品牌，隶属于四川百茶百道实业股份有限公司，截至2024年2月18日，茶百道在全国31个省市拥有7927家门店，包括7921家加盟店及6家直管店。'),(10,107,'瑞幸咖啡','/profile/upload/2024/06/06/2024-06-06_195307_20240606195312A016.jpg','橘园食堂一楼 瑞幸咖啡（英文名：luckin coffee，简称“瑞幸”），成立于2017年，是一家中国咖啡连锁品牌，总部位于厦门，由神州优车创始人陆正耀、神州优车COO钱治亚创立。公司定位新零售专业咖啡运营商，致力推动咖啡消费在国内的普及和发展，主要产品有拿铁（生椰拿铁、厚乳拿铁、酱香拿铁）、瑞纳冰、美式咖啡等咖啡制品、茶饮产品“小鹿茶”系列 [71]等。'),(11,109,'江紫弦牛逼',NULL,'6666666'),(12,122,'costa','/profile/upload/2024/06/07/2024-06-06_224711_20240607135330A002.jpg','梅园食堂一楼 cosata咖啡店');
/*!40000 ALTER TABLE `store` ENABLE KEYS */;
